const Course = (props) => {
  //make course an array
  const makearray = Object.values({... props.course})

  //seperate parts from course
  var classes = makearray.parts
  console.log("parts = ", classes)

// figure out part titles
  var result = classes.map((title) => {
    return title.name
  }
  )
  console.log("results = ", result)

  return (
    <div>
      <h1>{props.course.name}</h1>
    </div>
  )
}

const App = () => {
  const course = {
    id: 1,
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }

  return <Course course={course} />
}

export default App
